/**
 * @param {string} s
 * @return {string}
 */
var lastSubstring = function(s) {
	let checkP = {};
	for (let i = 0; i < s.length; i++) {
		checkP[i] = 1;
	}
	// console.log(checkP)

	function findS(checkP, checkLen) {
		let strIndexArr = [];
		for (let idx in checkP) {
			strIndexArr.push([s.substr(idx, checkLen), Number(idx)])
		}
		// console.log(strIndexArr)
		let maxIdx = 0;
		for (let i = 0; i < strIndexArr.length; i++) {
			if (strIndexArr[maxIdx][0] < strIndexArr[i][0]) {
				maxIdx = i;
			} else if (strIndexArr[maxIdx][0] == strIndexArr[i][0] && i != 0) {
				if (s.substr(strIndexArr[maxIdx][1]) > s.substr(strIndexArr[i][1])) {
					continue;
				} else {
					maxIdx = i;
				}
			}
		}
		// console.log(maxIdxs)
		checkP = {};
		return s.substr(strIndexArr[maxIdx][1]);
		// if (maxIdxs.length == 1)
		// maxIdxs.forEach(v => {
		// 	let [str, idx] = strIndexArr[v];
		// 	checkP[idx] = str;
		// })
		// return findS(checkP, checkLen + 1);

	}
	return findS(checkP, 1);
};
console.time();
// let s = "bbbbb";
let s="";
console.log(
	lastSubstring(s)
);
console.timeEnd();
